	var tag_uuid = 0

	constraintbox = new Taggle('constraint-box', {
		allowDuplicates: true,
		placeholder: 'Add Constraint..',
		onTagAdd: function(event, tag) {
			console.log(event)
			$(constraintbox.getTagElements()[constraintbox.getTagElements().length - 1]).attr("uuid", tag_uuid)
			parseTag(tag, event, tag_uuid);
			tag_uuid += 1;
    	},
	    onTagRemove: function(event, tag) {
	    	console.log(event);
	        removeTag(tag);
	    }
	});
	var container = constraintbox.getContainer();
	var input = constraintbox.getInput();


	var autocomplete_suggestions = ["req:", "req:#no:1000"]

	$(input).autocomplete({
		appendTo: $('#container'),
		autoFocus: true,
		minLength: 0,
	    source: autocomplete_suggestions, // { label: "Choice1", value: "value1" }
	    position: { at: 'left bottom', of: container },
	    select: function(e, v) {
	        e.preventDefault();
	        //Add the tag if user clicks
	        if (e.which === 1) {
	            constraintbox.add(v.item.value);
	        }
	    }
	});


	loadNewForceGraph();
	loadNewCircleLayout();
	addDummyImages();


