function addToTree(regions, azs, aggregates, racks, per_rack) {
	for (var i = 0; i < regions; i++) {
		var name = "Region " + i;
		tree.children.push({"name": name, "children": []})
		for (var j = 0; j < azs; j++) {
			var azname = "AZ " + j;
			tree.children[i].children.push({"name": azname, "children": []})
			for (var k = 0; k < aggregates; k++) {
				var aggname = "Aggregate " + k;
				tree.children[i].children[j].children.push({"name": aggname, "children": []});
				for (var l = 0; l < racks; l++) {
					var rackname = "Rack " + l;
					tree.children[i].children[j].children[k].children.push({"name": rackname, "children": []});
					var hosts_in_rack = Math.random() * per_rack;
					for (var m = 0; m < hosts_in_rack; m++) {
						var hostname = "Host " + m;
						tree.children[i].children[j].children[k].children[l].children.push({"name": hostname, "size": 200});
					}
				}
			}
		}
	}

	//var host = {"free_disk_mb": 10240, "free_ram_mb": 512, "node": host, "nodename": node, "total_useable_disk_gb": 10, "uuid": inventResourceID(), "vcpus": 900 }
}

